create table `13-1-2`
(
    direction  varchar(512) not null,
    hammerTime varchar(512) not null,
    hour       int          not null,
    minute     int          not null
);

create index direction
    on `13-1-2` (direction);

create index hammerTime
    on `13-1-2` (hammerTime);

create index hour
    on `13-1-2` (hour);

create index minute
    on `13-1-2` (minute);

